import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
  Container, TextField, Button, Typography, Box, List, ListItem, ListItemText,
  IconButton, Dialog, DialogActions, DialogContent, DialogContentText, DialogTitle,
  MenuItem, Select, InputLabel, FormControl
} from '@mui/material';
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';

function Teams() {
  const [teams, setTeams] = useState([]);
  const [name, setName] = useState('');
  const [editTeam, setEditTeam] = useState(null);
  const [deleteTeam, setDeleteTeam] = useState(null);

  useEffect(() => {
    fetchTeams();
  }, []);

  const fetchTeams = async () => {
    try {
      const response = await axios.get('http://localhost:3000/api/teams', {
        headers: { Authorization: `Bearer ${sessionStorage.getItem('token')}` }
      });
      setTeams(response.data);
    } catch (error) {
      console.error('Error fetching teams:', error);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const teamData = { name };
    if (editTeam) {
      try {
        const response = await axios.put(`http://localhost:3000/api/teams/${editTeam._id}`, teamData, {
          headers: { Authorization: `Bearer ${sessionStorage.getItem('token')}` }
        });
        setTeams(teams.map((team) => (team._id === editTeam._id ? response.data : team)));
        setEditTeam(null);
        setName('');
      } catch (error) {
        console.error('Error updating team:', error);
      }
    } else {
      try {
        const response = await axios.post('http://localhost:3000/api/teams', teamData, {
          headers: { Authorization: `Bearer ${sessionStorage.getItem('token')}` }
        });
        setTeams([...teams, response.data]);
        setName('');
      } catch (error) {
        console.error('Error creating team:', error);
      }
    }
  };

  const handleEdit = (team) => {
    setEditTeam(team);
    setName(team.name);
  };

  const handleDelete = async () => {
    try {
      await axios.delete(`http://localhost:3000/api/teams/${deleteTeam._id}`, {
        headers: { Authorization: `Bearer ${sessionStorage.getItem('token')}` }
      });
      setTeams(teams.filter((team) => team._id !== deleteTeam._id));
      setDeleteTeam(null);
    } catch (error) {
      console.error('Error deleting team:', error);
    }
  };

  return (
    <Container maxWidth="md">
      <Box sx={{ mt: 8 }}>
        <Typography variant="h4" gutterBottom>Teams</Typography>
        <form onSubmit={handleSubmit}>
          <TextField
            label="Team Name"
            fullWidth
            value={name}
            onChange={(e) => setName(e.target.value)}
            required
            margin="normal"
          />
          <Button type="submit" variant="contained" color="primary" fullWidth sx={{ mt: 2 }}>
            {editTeam ? 'Update Team' : 'Add Team'}
          </Button>
        </form>
        <List sx={{ mt: 4 }}>
          {teams.map((team) => (
            <ListItem key={team._id} secondaryAction={
              <>
                <IconButton edge="end" aria-label="edit" onClick={() => handleEdit(team)}>
                  <EditIcon />
                </IconButton>
                <IconButton edge="end" aria-label="delete" onClick={() => setDeleteTeam(team)}>
                  <DeleteIcon />
                </IconButton>
              </>
            }>
              <ListItemText primary={team.name} />
            </ListItem>
          ))}
        </List>

        <Dialog open={!!deleteTeam} onClose={() => setDeleteTeam(null)}>
          <DialogTitle>Delete Team</DialogTitle>
          <DialogContent>
            <DialogContentText>
              Are you sure you want to delete the team "{deleteTeam?.name}"?
            </DialogContentText>
          </DialogContent>
          <DialogActions>
            <Button onClick={() => setDeleteTeam(null)}>Cancel</Button>
            <Button onClick={handleDelete} color="error">Delete</Button>
          </DialogActions>
        </Dialog>
      </Box>
    </Container>
  );
}

export default Teams;
